(28, 24, 1, 'Whisky', 'Kentucky- Smooth and approachable with an easy finish, a true contrast to hot, harsh whiskies that \"blow your ears off\" and a downright revolutionary idea at the time. Maker\'s Mark is made slowly in small batches, in our National Historic Landmark distill', NULL, 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(29, 26, 1, 'Brandy', 'One of the most distinctive qualities of E & J Brandy is its remarkable character. This is accomplished by vertical blending of brandies of different ages from the finest white oak barrels. This aging process also develops the full and natural brandy flav', NULL, 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(30, 26, 1, 'Tequila', 'Tequila is a popular distilled spirit that is rich in history, far beyond the popular margarita or tequila shot. Originally used during rituals beginning 2,000 years ago, tequila has evolved into the potent spirit we drink today. In recent years, it has t', NULL, 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(31, 27, 1, 'Rum', 'Barbados- Made in the spirit of traditional Caribbean flavored rums and filled with the fresh, natural taste of coconut, this smooth-drinking rum infuses any drink with a taste of the tropics. Perfect on its own or as a refreshing splash in any rum-based ', NULL, 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(32, 27, 1, 'Bacardi Limon', 'The original modern icon from Bacardi. It\'s chic, adult, innovative, and desirable. Bacardi has crafted Limon in honor of the long-lasting tradition of drinking BACARDI rums on the rocks with lime.', NULL, 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(33, 25, 1, 'Spirits', 'Crystal clear, pure ultra premium. Light, fresh spirits is a favorite of connoisseurs worldwide. Smooth, soft, light tequila. The perfect ingredient in special margaritas or mixed cocktails, neat or on the rocks.', NULL, 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(34, 25, 1, 'Bourbon', 'The dry, clean flavor is mellow and spice with rye, not hot in the throat. This 90-proof Kentucky bourbon delivers a wonderfully complex taste with hints of vanilla and honey and a long smoky finish.', NULL, 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(35, 23, 1, 'Beer', 'beer Ã¢â‚¬â€œ formerly known as Ã¢â‚¬Å“Bass FinestÃ¢â‚¬Â Ã¢â‚¬â€œ pours a ruby colour with a white, thinnish head. The nose is quite subdued, with nettle and light malt notes and a nutty character. On the palate it is quite fresh and fruity, with moderat', NULL, 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(36, 24, 1, 'Scotch', 'The original Walker family blend, handcrafted from as many as 40 of the finest Scotch whiskies aged a minimum of 12 years, for a smooth and robust blend. Rich smoky malt, peat and sherry fruit character deliver a satisfyingly complex flavor on the long, l', NULL, 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
