(52, 34, 1, 'Lilies', 'really excellent plants for beds and borders. Lilies are suitable for use in a shrub border, as accent plants, a formal or naturalized pool planting', NULL, 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(53, 17, 1, 'Beverages', 'A drink is a liquid intended for human consumption. In addition to their basic function of satisfying thirst, drinks play important roles in human culture', NULL, 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(54, 17, 1, 'Bread/Bakery', 'Bakery products, particularly bread, have a long history of development. The biochemistry of the main components of wheat flour (proteins, carbohydrates, and lipids) are presented and discussed with a focus on those properties relevant to the baking indus', NULL, 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(55, 17, 1, 'Staples', 'Products purchased regularly and out of necessity are considered \"staple goods\" to your store. Traditionally, these items have fewer markdowns and sometimes lower profit margins. While price shifts may raise or lower demand for certain kinds of products, ', NULL, 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(56, 18, 1, 'Dairy', 'Dairy products, milk products or lacticinia are a type of food produced from or containing the milk of mammals. They are primarily produced from mammals such as cattle, water buffaloes, goats, sheep, camels and humans', NULL, 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(57, 18, 1, 'Dry/Baking Goods', 'Baked goods are cooked by baking, a method ofcooking food that uses prolonged dry heat, normally in an oven, but also in hot ashes, or on hot stones. The most common baked item is bread but many other types of foods are baked as well.', NULL, 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(58, 19, 1, 'Chocolates & Sweets', 'Candy, also called sweets or lollies, is a confection that features sugar as a principal ingredient. The category, called sugar confectionery, encompasses any sweet confection, including chocolate, chewing gum, and sugar candy', NULL, 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(59, 19, 1, 'Soft Drinks', 'The sweetener may be a sugar, high-fructose corn syrup, fruit juice, a sugar substitute (in the case of diet drinks), or some combination of these. Soft drinks may also contain caffeine, colorings, preservatives, and/or other ingredients. Soft drinks are ', NULL, 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(60, 19, 1, 'Packaged food', 'The majority of your diet should still be made up of real, whole foodsÃ¢â‚¬â€think vegetables, fruits, whole grains, proteins. Packaged foods get a bad rap for their long ingredient lists, trans fats and sodium, but not all packaged foods are created equ', NULL, 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(61, 20, 1, 'Dals and Pulses', 'Dal is a term used in the Indian subcontinent for dried, split pulses. The term is also used for various soups prepared from these pulses. These pulses are among the most important staple foods in South Asian countries, and form an important part of the c', NULL, 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(62, 20, 1, 'Pickles & Chutney', 'Some pickles and chutneys in India has been passed over to commercial production, whereas at one time it was done entirely in people\'s homes. The disadvantage of commercial chutneys and those produced in western style with vinegar and large amounts of sug', NULL, 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(63, 20, 1, 'Ketchups & Spreads', 'Ketchup is a sauce used as a condiment. Originally, recipes used egg whites, mushrooms, oysters, mussels, or walnuts, among other ingredients,but now the unmodified term usually refers to tomato ketchup. Various other terms for the sauce include catsup, c', NULL, 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(64, 21, 1, 'Masalas & Spices', 'masala is a spice mixture that has been ground into a powder or paste used for cooking Indian food, or a dish flavored with this powder.', NULL, 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(65, 21, 1, 'Dry Fruits, Nuts & Seeds', 'Dried fruit is fruit from which the majority of the original water content has been removed either naturally, through sun drying, or through the use of specialized dryers or dehydrators. A nut is a fruit composed of an inedible hard shell and aseed, which', NULL, 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(66, 21, 1, 'Health Drink Mix', 'water topped the list, but that doesn\'t mean it\'s the only healthy choice. Unsweetened tea, coffee and milk have a place in your healthy eating plan, while juice, alcohol and sweetened beverages should be consumed sparingly. Water helps restore fluid loss', NULL, 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
