(148, 17, 1, 'Popcorn', 'Popcorn is a variety of corn kernel, which expands and puffs up when heated. A popcorn kernel\'s strong hull contains the seed\'s hard, starchy endosperm with 14Ã¢â‚¬â€œ20% moisture, which turns to steam as the kernel is heated', 'https://api.konek.today/images/order/items/popcorn.png', 0, 'Pure Veg', '60.00', '0.00', 'PERCENTAGE', 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(149, 17, 1, 'Snacky Nuts', 'A nut is a fruit composed of an inedible hard shell and a seed, which is generally edible. In general usage, a wide variety of dried seeds are called nuts, but in a botanical context \"nut\" implies that the shell does not open to release the seed', 'https://api.konek.today/images/order/items/snacky_nuts.png', 0, 'Pure Veg', '38.00', '0.00', 'PERCENTAGE', 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(150, 17, 1, 'Bread  ', 'ThereÃ¢â‚¬â„¢s nothing like taking a loaf of fresh yeast bread out of the oven. Just the enticing scent alone makes one of the worldÃ¢â‚¬â„¢s most celebrated foods worth baking! From a handful of ingredientsÃ¢â‚¬â€at its most basic flour, yeast, water, a', 'https://api.konek.today/images/order/items/bread__.png', 0, 'Pure Veg', '20.00', '0.00', 'PERCENTAGE', 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(151, 17, 1, 'Cooking Oils', '.Cooking oil is plant, animal, or synthetic fat used in frying, baking, and other types of cooking. It is also used in food preparation and flavouring not involving heat, such as salad dressings and bread dips, and in this sense might be more accurately t', 'https://api.konek.today/images/order/items/cooking_oils.png', 0, 'Pure Veg', '180.00', '0.00', 'PERCENTAGE', 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(152, 17, 1, 'Cakes  ', 'Layer cakes, cupcakes, snack cakes, roulades, and even cheesecakesÃ¢â‚¬â€the cake category is vast. Most cakes are often classified into two categories: whether they contain fat, such as butter or oil (shortened cakes) or whether they contain little or n', 'https://api.konek.today/images/order/items/cakes__.png', 0, 'Pure Veg', '86.00', '0.00', 'PERCENTAGE', 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(153, 17, 1, 'Custard', 'Custards are thick, rich, creamy desserts typically made from eggs and milk or cream. They can be sweet or savory and flavored loads of different ways. Made on the stovetop or baked, they range from cheesecake and flan to ice cream, pastry cream, and even', 'https://api.konek.today/images/order/items/custard.png', 0, 'Pure Veg', '20.00', '0.00', 'PERCENTAGE', 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(154, 17, 1, 'Ghee   ', 'Ghee, is a class of clarified butter that originated in ancient India. It is commonly used in Middle Eastern cuisine, cuisine of the Indian subcontinent, Southeast Asian cuisine, traditional medicine, and religious rituals', 'https://api.konek.today/images/order/items/ghee___.png', 0, 'Pure Veg', '45.00', '0.00', 'PERCENTAGE', 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(155, 17, 1, 'Wheat', 'Wheat is a grass widely cultivated for its seed, a cereal grain which is a worldwide staple food. The many species of wheat together make up the genus Triticum; the most widely grown is common wheat', 'https://api.konek.today/images/order/items/wheat.png', 0, 'Pure Veg', '50.00', '0.00', 'PERCENTAGE', 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(156, 18, 1, 'Milk  ', 'Milk is a nutrient-rich, white liquid food produced by the mammary glands of mammals. It is the primary source of nutrition for infant mammals before they are able to digest other types of food    ', 'https://api.konek.today/images/order/items/milk__.png', 0, 'Pure Veg', '10.00', '0.00', 'PERCENTAGE', 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(157, 18, 1, 'Cheese  ', 'Cheese is a dairy product derived from milk that is produced in a wide range of flavors, textures, and forms by coagulation of the milk protein casein. It comprises proteins and fat from milk, usually the milk of cows, buffalo, goats, or sheep', 'https://api.konek.today/images/order/items/cheese__.png', 0, 'Pure Veg', '30.00', '0.00', 'PERCENTAGE', 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(158, 18, 1, 'Soya Milk', 'Soy milk or soymilk is a plant-based drink produced by soaking and grinding soybeans, boiling the mixture, and filtering out remaining particulates. It is a stable emulsion of oil, water, and protein. Its original form is a natural by-product', 'https://api.konek.today/images/order/items/soya_milk.png', 0, 'Pure Veg', '40.00', '0.00', 'PERCENTAGE', 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(159, 18, 1, 'Cocoa Powder ', 'Trader JoeÃ¢â‚¬â„¢s sells unsweetened cocoa powder that is delicious in my recipe for TÃ¢â‚¬â„¢s Dreamy Chocolate Sauce for our Dessert Nachos for Breakfast! YUM!!! I also buy raw cacao powder. ', 'https://api.konek.today/images/order/items/cocoa_powder_.png', 0, 'Pure Veg', '40.00', '0.00', 'PERCENTAGE', 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(160, 18, 1, 'Chocolate Chips', 'prefer to use cacao nibs (and cacao/cocoa powder) whenever possible. My husband and kids really like chocolate chips. Look at the ingredient label to make sure that they do not contain any dairy', 'https://api.konek.today/images/order/items/chocolate_chips.png', 0, 'Pure Veg', '40.00', '0.00', 'PERCENTAGE', 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL);
INSERT INTO `store_items` (`id`, `store_id`, `company_id`, `item_name`, `item_description`, `picture`, `store_category_id`, `is_veg`, `item_price`, `item_discount`, `item_discount_type`, `is_addon`, `status`, `created_type`, `created_by`, `modified_type`, `modified_by`, `deleted_type`, `deleted_by`, `created_at`, `updated_at`, `deleted_at`) VALUES
(161, 19, 1, 'Chocolates  ', 'Chocolate is a usually sweet, brown food preparation of roasted and ground cacao seeds that is made in the form of a liquid, paste, or in a block, or used as a flavoring ingredient in other foods   ', 'https://api.konek.today/images/order/items/chocolates__.png', 0, 'Pure Veg', '45.00', '0.00', 'PERCENTAGE', 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(162, 19, 1, 'Gums', 'The purpose of GEMS/Food is to compile data on food contamination and human exposure from different countries for global synthesis, evaluation and presentation.', 'https://api.konek.today/images/order/items/gums.png', 0, 'Pure Veg', '5.00', '0.00', 'PERCENTAGE', 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(163, 19, 1, 'Mouth Freshner', 'Spraymintt is a one second mouth freshener that makes you kiss ready in just one second. With its natural formulation and no side effects it is the best solution for instant mouth freshener', 'https://api.konek.today/images/order/items/mouth_freshner.png', 0, 'Pure Veg', '35.00', '0.00', 'PERCENTAGE', 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(164, 19, 1, 'Friut Drinks', '.Juice is a drink made from the extraction or pressing of the natural liquid contained in fruit and vegetables. It can also refer to liquids that are flavored with concentrate or other biological food sources, such as meat or seafood, such as clam juice  ', 'https://api.konek.today/images/order/items/friut_drinks.png', 0, 'Pure Veg', '35.00', '0.00', 'PERCENTAGE', 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(165, 19, 1, 'Energy Drink', 'An energy drink is a type of drink containing sugar and stimulant compounds, usually caffeine, which is marketed as providing mental and physical stimulation. They may or may not be carbonated and may also contain other sweeteners, herbal extracts, taurin', 'https://api.konek.today/images/order/items/energy_drink.png', 0, 'Pure Veg', '50.00', '0.00', 'PERCENTAGE', 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(166, 19, 1, 'Noodles', 'Noodles are unleavened dough which is stretched, extruded, or rolled flat and cut into one of a variety of shapes which usually include long, thin strips, or waves, helices, tubes, strings, or shells, or folded over, or cut into other shapes       ', 'https://api.konek.today/images/order/items/noodles.png', 0, 'Pure Veg', '50.00', '0.00', 'PERCENTAGE', 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(167, 19, 1, 'Pasta', 'Pasta is type of noodle typically made from an unleavened dough of durum wheat flour mixed with water or eggs, and formed into sheets or various shapes, then cooked by boiling or baking', 'https://api.konek.today/images/order/items/pasta.png', 0, 'Pure Veg', '75.00', '0.00', 'PERCENTAGE', 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(168, 20, 1, 'Toor dal', 'perennial legume from the family Fabaceae. Since its domestication in the Indian subcontinent at least 3,500 years ago, its seeds have become a common food in Asia, Africa, and Latin America', 'https://api.konek.today/images/order/items/toor_dal.png', 0, 'Pure Veg', '45.00', '0.00', 'PERCENTAGE', 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(169, 20, 1, 'Urad dal ', 'Vigna mungo, black gram, urad bean, urid bean, minapa pappu, mungo bean or black matpe bean is a bean grown in the Indian subcontinent. Like its relative, the mung bean, it has been reclassified from the Phaseolus to the Vigna genus', 'https://api.konek.today/images/order/items/urad_dal_.png', 0, 'Pure Veg', '45.00', '0.00', 'PERCENTAGE', 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(170, 20, 1, 'Moong Dall', 'The mung bean, alternatively known as the green gram, maash, or moong , is a plant species in the legume family. The mung bean is mainly cultivated in East Asia, Southeast Asia and Indian subcontinent', 'https://api.konek.today/images/order/items/moong_dall.png', 0, 'Pure Veg', '65.00', '0.00', 'PERCENTAGE', 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(171, 20, 1, 'Pickles  ', 'A pickled cucumber is a cucumber that has been pickled in a brine, vinegar, or other solution and left to ferment for a period of time, by either immersing the cucumbers in an acidic solution or through souring by lacto-fermentation. ', 'https://api.konek.today/images/order/items/pickles__.png', 0, 'Pure Veg', '55.00', '0.00', 'PERCENTAGE', 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(172, 20, 1, 'Chutney', 'Chutney is a sauce or a dry base for a sauce, originating from the Indian subcontinent, used with the cuisines of the Indian subcontinent, that can include such forms as a spicy coconut dip, a tomato relish, a ground peanut garnish or a dahi, cucumber, an', 'https://api.konek.today/images/order/items/chutney.png', 0, 'Pure Veg', '35.00', '0.00', 'PERCENTAGE', 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(173, 20, 1, 'Ketchups   ', 'Ketchup is a sauce used as a condiment. Originally, recipes used egg whites, mushrooms, oysters, mussels, or walnuts, among other ingredients, but now the unmodified term usually refers to tomato ketchup ', 'https://api.konek.today/images/order/items/ketchups___.png', 0, 'Pure Veg', '60.00', '0.00', 'PERCENTAGE', 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(174, 20, 1, 'Dip Spreads', '.A spread is a food that is spread, generally with a knife, onto foods such as bread and crackers. Spreads are added to food to enhance the flavor or texture of the food, which may be considered bland without it. Butter and soft cheeses are typical spread', 'https://api.konek.today/images/order/items/dip_spreads.png', 0, 'Pure Veg', '35.00', '0.00', 'PERCENTAGE', 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(175, 21, 1, 'Powdered Spices', 'Spices are used in different forms: whole, chopped, ground, roasted, sautÃƒÂ©ed, fried, and as topping. They blend food to extract the nutrients and bind them in a palatable form. Some spices are added at the end as a flavouring and are typically heated i', 'https://api.konek.today/images/order/items/powdered_spices.png', 0, 'Pure Veg', '30.00', '0.00', 'PERCENTAGE', 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(176, 21, 1, 'Whole Spices', 'Fenugreek is used to add flavor to meat dishes. It is also considered as an aphrodisiac. Garam Masala Ã¢â‚¬â€œ meaning Ã¢â‚¬Å“hot spicesÃ¢â‚¬Â - is a mixture of ground spices (recipes vary) (cloves, cardamom, cumin, peppercorns and cinnamon, bay leaves).', 'https://api.konek.today/images/order/items/whole_spices.png', 0, 'Pure Veg', '30.00', '0.00', 'PERCENTAGE', 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(177, 21, 1, 'Cooking Paste', 'A food paste is a semi-liquid colloidal suspension, emulsion, or aggregation used in food preparation or eaten directly as a spread. Pastes are often highly spicy or aromatic, are often prepared well in advance of actual usage, and are often made into a p', 'https://api.konek.today/images/order/items/cooking_paste.png', 0, 'Pure Veg', '50.00', '0.00', 'PERCENTAGE', 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(178, 21, 1, 'Cashew Nuts', 'The cashew tree is a tropical evergreen tree that produces the cashew seed and the cashew apple. It can grow as high as 14 m,  growing up to 6 m, has proved more profitable, with earlier maturity and higher yields', 'https://api.konek.today/images/order/items/cashew_nuts.png', 0, 'Pure Veg', '50.00', '0.00', 'PERCENTAGE', 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(179, 21, 1, 'Edible Seeds', 'Edible seeds are angiosperms, but a few are gymnosperms. The most important global seed food source, by weight, is cereals, followed by legumes, and nuts.', 'https://api.konek.today/images/order/items/edible_seeds.png', 0, 'Pure Veg', '30.00', '0.00', 'PERCENTAGE', 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(180, 21, 1, 'Dried Fruits', 'Dried fruit is fruit from which the majority of the original water content has been removed either naturally, through sun drying, or through the use of specialized dryers or dehydrators  ', 'https://api.konek.today/images/order/items/dried_fruits.png', 0, 'Pure Veg', '40.00', '0.00', 'PERCENTAGE', 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(181, 21, 1, 'Health Powder Mix', 'Multigrain Health Drink. This is the ultimate health drink powder for kids, with ingredients like millet, horse gram, sago, almonds, pistachios, cashew nuts and many others.', 'https://api.konek.today/images/order/items/health_powder_mix.png', 0, 'Pure Veg', '50.00', '0.00', 'PERCENTAGE', 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(182, 35, 1, 'Sugar Beans Bunny', '1/4 Sugar Beans Bunny', 'https://api.konek.today/storage/1/shops/items/e71fcbd7f5f5dc3b9236b5cb7e83c35b748b4c43.JPG', 68, 'Pure Veg', '50.00', '0.00', 'PERCENTAGE', 0, 1, 'SHOP', 35, 'SHOP', 35, NULL, NULL, '2019-11-07 13:50:18', '2019-11-07 13:51:04', NULL),
