(184, 37, 1, 'Red Wine', 'Red Wine', 'https://api.konek.today/storage/1/shops/items/617457444a90a09234d4ed0a2d5bf8774f563c63.JPG', 70, NULL, '50.00', '0.00', 'PERCENTAGE', 0, 1, 'SHOP', 37, 'SHOP', 37, NULL, NULL, '2019-11-11 16:03:58', '2019-11-11 16:03:58', NULL),
(185, 38, 1, 'Rice', 'Tasty', 'https://api.konek.today/storage/1/shops/items/101682a91b22a69d0a0d07bf46870c3008e102ff.png', 71, 'Pure Veg', '100.00', '10.00', 'PERCENTAGE', 0, 1, 'SHOP', 38, 'SHOP', 38, NULL, NULL, '2019-11-13 12:09:33', '2019-11-13 12:12:04', NULL);
